import express from "express";
import morgan from "morgan";
import helmet from "helmet";
import cookieParser from "cookie-parser";
import bodyParser from "body-parser";
import passport from "passport";
import mongoose from "mongoose";
import session from "express-session";
import MongoStore from "connect-mongo";
import { localsMiddleWare } from "./middlewares";
import routes from "./routes";
import userRouter from "./routers/userRouter";
import videoRouter from "./routers/videoRouter";
import globalRouter from "./routers/globalRouter";
import apiRouter from "./routers/apiRouter";

import "./passport";

const app = express();

const CookieStore = MongoStore(session);

app.use(helmet());
app.set("view engine", "pug");
app.use("/uploads", express.static("uploads"));
app.use("/static", express.static("static"));
app.use(cookieParser());
app.use(bodyParser.json());
app.use(bodyParser.urlencoded({ extended: true }));
app.use(morgan("dev"));
app.use(
  session({
    secret: process.env.COOKIE_SECRET,
    // ë¬´ìž‘ìœ„ ë¬¸ìžì—´ë¡œ ì¿ í‚¤ì— ë“¤ì–´ìžˆëŠ” session IDë¥¼ ì•”í˜¸í™” í•˜ê¸° ìœ„í•œê²ƒ
    resave: true,
    // ì„¸ì…˜ì„ ê°•ì œë¡œ ì €ìž¥í•˜ê²Œ í•©ë‹ˆë‹¤
    saveUninitialized: false,
    // ì´ˆê¸°í™” í•˜ì§€ ì•Šì€(uninitialized)ì„¸ì…˜ì„ ì €ìž¥ì†Œì— ì €ìž¥í•©ë‹ˆë‹¤
    store: new CookieStore({ mongooseConnection: mongoose.connection })
    // ì´ ì¿ í‚¤ ì €ìž¥ì†Œì— ì €ìž¥, ì´ ì €ìž¥ì†Œë¥¼ mongoì™€ ì—°ê²°ì‹œì¼œì¤˜ì•¼í•¨
  })
);
app.use(passport.initialize());
// passport ì´ˆê¸°í™”
// initialize í•´ë‘ë©´ user ì˜ ì •ë³´ê°€ req.user ì— ì‹¤ë¦°ë‹¤
app.use(passport.session());
// sessionì— ì €ìž¥

app.use(localsMiddleWare);

app.use(routes.home, globalRouter);
app.use(routes.users, userRouter);
app.use(routes.videos, videoRouter);
app.use(routes.api, apiRouter);

export default app;

