import passport from "passport";
import routes from "../routes";
import User from "../models/User";

export const getJoin = (req, res) => {
  res.render("join", { pageTitle: "Join" });
};

export const postJoin = async (req, res, next) => {
  const {
    body: { name, email, password, password2 }
  } = req;
  if (password !== password2) {
    res.status(400);
    res.render("join", { pageTitle: "Join" });
  } else {
    // To Do: Register User
    try {
      const user = await User({
        // ì‚¬ìš©ìž ìƒì„±
        name,
        email
      });
      await User.register(user, password);
      // ì‚¬ìš©ìž ë“±ë¡
      next();
    } catch (error) {
      console.log(error);
      res.redirect(routes.home);
    }
  }
};

export const getLogin = (req, res) =>
  res.render("login", { pageTitle: "Login" });

export const postLogin = passport.authenticate("local", {
  // passport.authenticateì€ usernameê³¼ passwordë¥¼ ì°¾ì•„ë³´ë„ë¡ ì„¤ì •ë˜ì–´ìžˆìŒ
  // "local"ì€ ìš°ë¦¬ê°€ ì„¤ì¹˜í•´ì¤€ Strategyì˜ ì´ë¦„ì´ë‹¤
  failureRedirect: routes.login,
  // ë¡œê·¸ì¸ í•˜ëŠ”ë° ì‹¤íŒ¨í•˜ë©´ ë¡œê·¸ì¸ìœ¼ë¡œ
  successRedirect: routes.home
  // ë¡œê·¸ì¸ ì„±ê³µì‹œ í™ˆìœ¼ë¡œ
});

export const githubLogin = passport.authenticate("github");
// passportì˜ strategyì¤‘ githubì„ ì´ìš©

export const githubLoginCallback = async (_, __, profile, cb) => {
  // cbí•¨ìˆ˜ëŠ” ì¸ì¦ì— ì„±ê³µí•œ ìƒí™©í•´ì„œ í˜¸ì¶œ í•´ì•¼í•œë‹¤.
  const {
    _json: { id, avatar_url: avatarUrl, name, email }
  } = profile;
  try {
    const user = await User.findOne({ email });
    // ê¹ƒí—™ìœ¼ë¡œ ë¶€í„° ì˜¨ emailê³¼ ë™ì¼í•œ emailì„ ê°€ì§„ ì‚¬ìš©ìžë¥¼ ì°¾ëŠ”ë‹¤.
    if (user) {
      // ë™ì¼í•œ emailì„ ê°€ì§„ userê°€ ìžˆìœ¼ë©´ ì •ë³´ë¥¼ ê°±ì‹ í•œë‹¤
      user.githubId = id;
      // user.githubIDë¥¼ githubì—ì„œ ê°€ì ¸ì˜¨ idë¡œ í• ë‹¹í•œë‹¤
      user.save();
      // ê·¸ë¦¬ê³  ì €ìž¥í•´ì¤˜ì•¼í•œë‹¤.
      return cb(null, user);
      // ì´ë©”ì¼ ë™ì¼í•œ ì‚¬ìš©ìžë¥¼ ì°¾ì•˜ì„ë•Œ cbí•¨ìˆ˜ë¥¼ í˜¸ì¶œí•œë‹¤
      // ì—ëŸ¬ëŠ” ì—†ìŒ(null), userëŠ” ì°¾ì•˜ìŠµë‹ˆë‹¤.
      // ê·¸ëž˜ì„œ ì´ê±¸ ì¿ í‚¤ì— ì €ìž¥í•  ìˆ˜ ìžˆê²Œ ëœë‹¤.
    }
    const newUser = await User.create({
      // ì‚¬ìš©ìžë¥¼ ì°¾ì§€ ëª»í–ˆìœ¼ë©´ ê³„ì •ì„ ë§Œë“ ë‹¤.
      email,
      name,
      githubId: id,
      avatarUrl
    });
    return cb(null, newUser);
  } catch (error) {
    return cb(error);
  }
};

export const postGithubLogIn = (req, res) => {
  res.redirect(routes.home);
};

export const postNaverLogin = (req, res) => {
  res.redirect(routes.home);
};

export const naverLogin = passport.authenticate("naver");

export const naverLoginCallback = async (_, __, profile, cb) => {
  const {
    _json: { id, profile_image: avatarUrl, nickname: name, email }
  } = profile;
  try {
    const user = await User.findOne({ email });
    if (user) {
      user.naverId = id;
      user.save();
      return cb(null, user);
    }
    const newUser = await User.create({
      email,
      name,
      naverId: id,
      avatarUrl
    });
    return cb(null, newUser);
  } catch (error) {
    return cb(error);
  }
};

export const logout = (req, res) => {
  req.logout();
  // passportë¥¼ ì‚¬ìš©í• ë•Œ ì´ë ‡ê²Œ í•˜ë©´ ë¡œê·¸ì•„ì›ƒ ëœë‹¤.
  res.redirect(routes.home);
};

export const getMe = (req, res) => {
  res.render("userDetail", { pageTitle: "User Detail", user: req.user });
  console.log(req.user);
};

export const userDetail = async (req, res) => {
  const {
    params: { id }
  } = req;
  try {
    const user = await User.findById(id).populate("videos");
    console.log(user);
    res.render("userDetail", { pageTitle: "User Detail", user });
  } catch (error) {
    res.redirect(routes.home);
  }
};
export const getEditProfile = (req, res) =>
  res.render("editProfile", { pageTitle: "Edit Profile" });

export const postEditProfile = async (req, res) => {
  const {
    body: { name, email },
    file
  } = req;
  try {
    await User.findByIdAndUpdate(req.user.id, {
      name,
      email,
      avatarUrl: file ? file.location : req.user.avatarUrl
      // req.user.avatarUrlì€ í˜„ìž¬ ë¡œê·¸ì¸í•œ ì‚¬ëžŒì˜ ì•„ë°”íƒ€ë§í¬
      // ë§Œì•½ ì—¬ê¸° ìƒˆë¡œìš´ avatarfileì´ ì—†ìœ¼ë©´ ì—…ë°ì´íŠ¸ í•˜ì§€ ì•ŠìŒ
    });
    res.redirect(routes.me);
  } catch (error) {
    res.redirect(routes.editProfile);
  }
};

export const getChangePassword = (req, res) => {
  res.render("changePassword", { pageTitle: "Change Password" });
};

export const postChangePassword = async (req, res) => {
  const {
    body: { oldPassword, newPassword, newPassword1 }
  } = req;
  try {
    if (newPassword !== newPassword1) {
      res.status(400);
      // ìƒíƒœì½”ë“œ400ì„ ì•ˆì£¼ë©´ ë¸Œë¼ìš°ì €ëŠ” ì„±ê³µì ì¸ê±¸ë¡œ ì•Œì•„ì„œ í¬ë¡¬ê¸°ì¤€ ë¹„ë²ˆì„ ì €ìž¥í•˜ë¼ê³ ëœ¸
      res.redirect(`/users/${routes.changePassword}`);
      return;
    }
    await req.user.changePassword(oldPassword, newPassword);
    // changePasswordëŠ” passport-local-mongooseì—ì„œ ì œê³µí•´ì£¼ëŠ”ê²ƒ
    res.redirect(routes.me);
  } catch (error) {
    res.status(400);
    res.redirect(`/users/${routes.changePassword}`);
  }
};

