import passport from "passport";
import GithubStrategy from "passport-github";
import NaverStrategy from "passport-naver";
import User from "./models/User";
import {
  githubLoginCallback,
  naverLoginCallback
} from "./controllers/userController";
import routes from "./routes";

passport.use(User.createStrategy());

passport.use(
  new GithubStrategy(
    {
      clientID: process.env.GH_ID,
      clientSecret: process.env.GH_SECRET,
      callbackURL: `http://localhost:4000${routes.githubCallback}`
    },
    githubLoginCallback
  )
  //  githubLoginCallbackì€ ì‚¬ìš©ìžê°€ ê¹ƒí—™ìœ¼ë¡œ ê°”ë‹¤ê°€ ëŒì•„ì˜¤ë©´ì„œ
  //  ì‚¬ìš©ìž ì •ë³´ë¥¼ ê°€ì ¸ì˜¤ë©´ ì´ í•¨ìˆ˜ê°€ ì‹¤í–‰ëœë‹¤.
  //  ëª¨ë“ ê²ƒì´ ë‹¤ ì •ìƒì ìœ¼ë¡œ ìž‘ë™í• ë•Œ githubLoginCallbackë¥¼ ì‹¤í–‰
);

passport.use(
  new NaverStrategy(
    {
      clientID: process.env.NAVER_ID,
      clientSecret: process.env.NAVER_SECRET,
      callbackURL: `http://localhost:4000${routes.naverCallback}`
    },
    naverLoginCallback
  )
